import { Dropdown } from "react-bootstrap"

function FilterCountryDropdown() {
    return (
        <Dropdown className="form-control header-input" placeholder="Search for a Country.." type="text">
        <Dropdown.Toggle variant="success" id="dropdown-basic">
          Dropdown Button
        </Dropdown.Toggle>
  
        <Dropdown.Menu>
        <input value={fitlerCountryName} onChange={(e) => setFilterCountryName(e.target.value)}
                 className="form-control header-input" type="text" placeholder="Search for a Country.." /> 
          <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
          <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
          <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
    )
}

export default FilterCountryDropdown;
